// SPDX-License-Identifier: MIT

pragma solidity 0.8.16;

contract NombrePremiers{
    function ifPrime(uint nbr) public pure returns (bool){
        if((nbr % nbr == 0) && nbr / 1 == 0)
        return true;

        else
        return false;
    }
}

